$("#logout").click(function () {
    swal({
        title: "Bạn muốn thoát ư?",
        type: "info", showCancelButton: true,
        closeOnConfirm: false,
        showLoaderOnConfirm: true,
    },
        function () {
            setTimeout(function () {
                swal("Tạm biệt!");
                window.location.href = "/Home/Logout";
            });
        });
})

$(".delete-button").click(function () {
    swal({
        title: "Bạn có muốn xóa?",
        type: "info", showCancelButton: true,
        closeOnConfirm: false,
        showLoaderOnConfirm: true,
    },
        function () {
            setTimeout(function () {
                success();
            }, 2000);
        });
})

function success(message, onOK) {
    if (message == null) {
        message = "Bạn đã thực hiện thành công!";
    }

    swal({
        title: "Thành công",
        text: message,
        type: "success"
    }, onOK);
    //swal("Thành công", message, "success")
}

function error(message) {
    if (message == null) {
        message = "Đã có lỗi xảy ra!";
    }
    swal("Thất bại", message, "error")
}

function clearInput() {
    $('#formValidate')[0].reset();
}

$(function () {
    $('.modal').modal();
    $('#modalfix').modal('open');
    $('#modalfix').modal('close');
});

function initInput() {
    $("select").material_select();
    $(".datepicker").pickadate({ selectMonths: !0, selectYears: 15 })
}

$(document).on("wheel", "input[type=number]", function (e) {
    $(this).blur();
});